import React from 'react';

import Product from './Product';

const ProductDisplayPage = (props) => {
    return (
      <ul>
        {props.products.map((product) => (
          <>
          <Product
            key={product.id}
            title={product.title}
            image={product.image}
            price={product.price}
            msrp={product.msrp}
            url={product.url}
          />
          <NavLink to={product.url} className="btn btn-outline-dark">
                      Buy Now
         </NavLink>
          </>
        ))}
      </ul>
    );
  };

  export default ProductDisplayPage;
